import React from 'react';
import './Temp.scss';

const MiniDesignSystem = () => {
  return (
    <article className="l-design-width">
      <div className="card card--inverted">
        <h2>
          <svg className="icon" aria-hidden="true">
            <use xlinkHref="#icon-coffee" href="#icon-coffee" />
          </svg>
          Inverted
        </h2>
        <label className="input">
          <input className="input__field" type="text" placeholder=" " value="" />
          <span className="input__label">Some Fancy Label</span>
        </label>
        <div className="button-group">
          <button>Send</button>
          <button type="reset">Reset</button>
        </div>
      </div>
      </article>
  );
};

export default MiniDesignSystem;
